/**
 * Run trained Random Forest inference
 */
function rfPredict(features) {
  const fa = MODEL.features.map(n => features[n] ?? 0);
  const votes = new Array(MODEL.classes.length).fill(0);
  
  for (const tree of MODEL.trees) {
    let n = tree;
    while (!n.l) { n = fa[n.f] <= n.t ? n.L : n.R; }
    votes[n.c]++;
  }
  
  return MODEL.classes.map((c, i) => [c, votes[i]]);
}

/**
 * Rule-based scoring (domain knowledge from faciometrics research)
 * Stronger at oval/round/heart disambiguation
 */
function ruleScore(f) {
  const s = { ovalado:0, redondo:0, cuadrado:0, corazon:0, alargado:0, diamante:0 };

  // OVAL: moderate WHR, cheekbones widest, gentle taper
  if (f.f1_whr >= 0.64 && f.f1_whr <= 0.80) s.ovalado += 3;
  if (f.f6_cfR >= 0.98 && f.f5_cjR >= 1.05) s.ovalado += 2;
  if (f.f10_cheekTaper >= 0.08 && f.f10_cheekTaper <= 0.25) s.ovalado += 3;
  if (f.f4_jfR >= 0.72 && f.f4_jfR <= 0.92) s.ovalado += 2;

  // ROUND: high WHR, all widths similar, soft jaw
  if (f.f1_whr >= 0.82) s.redondo += 4;
  if (f.f17_wVar < 0.10) s.redondo += 3;
  if (f.f13_jawAng >= 130) s.redondo += 2;
  if (f.f14_chinAng >= 135) s.redondo += 2;
  if (f.f10_cheekTaper < 0.10) s.redondo += 2;

  // SQUARE: angular jaw, widths similar
  if (f.f13_jawAng < 120) s.cuadrado += 4;
  if (f.f5_cjR < 1.12) s.cuadrado += 3;
  if (f.f4_jfR >= 0.86) s.cuadrado += 2;
  if (f.f15_jawSq >= 0.55) s.cuadrado += 2;

  // HEART: forehead widest, significant taper
  if (f.f6_cfR <= 1.03) s.corazon += 2;
  if (f.f11_fhTaper >= 0.22) s.corazon += 4;
  if (f.f4_jfR < 0.76) s.corazon += 3;
  if (f.f14_chinAng < 105) s.corazon += 3;

  // OBLONG: very low WHR
  if (f.f1_whr < 0.62) s.alargado += 5;
  if (f.f17_wVar < 0.15) s.alargado += 2;

  // DIAMOND: cheekbones clearly widest
  if (f.f6_cfR >= 1.12) s.diamante += 4;
  if (f.f5_cjR >= 1.15) s.diamante += 3;

  return Object.entries(s).map(([c, v]) => [c, v]);
}

/**
 * HYBRID classifier: combines ML model + rule-based scoring
 * ML model is better at cuadrado/alargado, rules are better at oval/redondo/corazon
 */
export function classifyFaceShape(features) {
  // Get ML prediction
  const rfVotes = rfPredict(features);
  const totalRF = rfVotes.reduce((s, [, v]) => s + v, 0);
  
  // Get rule-based scores
  const ruleVotes = ruleScore(features);
  const totalRules = ruleVotes.reduce((s, [, v]) => s + v, 0) || 1;
  
  // Normalize both to 0-1 range and combine (60% ML, 40% rules)
  const combined = {};
  const ML_WEIGHT = 0.6;
  const RULE_WEIGHT = 0.4;
  
  for (const [cls, votes] of rfVotes) {
    combined[cls] = (combined[cls] || 0) + (votes / totalRF) * ML_WEIGHT;
  }
  for (const [cls, score] of ruleVotes) {
    combined[cls] = (combined[cls] || 0) + (score / totalRules) * RULE_WEIGHT;
  }
  
  // Sort
  const sorted = Object.entries(combined).sort((a, b) => b[1] - a[1]);
  const [shape, topScore] = sorted[0];
  const [, secondScore] = sorted[1] || [null, 0];
  const total = sorted.reduce((s, [, v]) => s + v, 0);
  
  const rawConf = total > 0 ? (topScore / total) * 100 : 20;
  const margin = Math.min((topScore - secondScore) / total * 100, 15);
  const confidence = Math.min(Math.round(rawConf + margin), 95);
  
  return {
    shape,
    confidence,
    allScores: Object.fromEntries(sorted),
    whr: (features.f1_whr || 0).toFixed(3),
    jfr: (features.f4_jfR || 0).toFixed(3),
    cjr: (features.f5_cjR || 0).toFixed(3),
    features: {
      whr: features.f1_whr, cheekTaper: features.f10_cheekTaper,
      foreheadTaper: features.f11_fhTaper, jawAngle: features.f13_jawAng,
      chinAngle: features.f14_chinAng, widthVariance: features.f17_wVar,
    },
  };
}
